import React from 'react';
import { Row, Col, Breadcrumb, Pagination } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import ModuleNotification from '../../../components/Widgets/Statistic/Notification';

import Card from '../../../components/Card/MainCard';

const BasicBreadcrumbPagination = () => {
    let active = 3;
    let disabled = 4;
    let items = [];
    let activeItems = [];
    let disabledItems = [];

    for (let number = 1; number <= 5; number++) {
        items.push(<Pagination.Item key={number}>{number}</Pagination.Item>);
    }

    for (let number = 1; number <= 5; number++) {
        activeItems.push(
            <Pagination.Item key={number} active={number === active}>
                {number}
            </Pagination.Item>
        );
    }

    for (let number = 1; number <= 5; number++) {
        disabledItems.push(
            <Pagination.Item key={number} disabled={number === disabled}>
                {number}
            </Pagination.Item>
        );
    }

    return (
        <React.Fragment>
            <Row>
                <Col sm={12}>
                    <ModuleNotification
                        message="For more info please check the components's official documentation"
                        link="https://react-bootstrap.github.io/components/breadcrumb/"
                    />
                </Col>
            </Row>
            <Row>
                <Col md={6}>
                    <Card title="Breadcrumb">
                        <Breadcrumb>
                            <Breadcrumb.Item as={Link} to="#" active>
                                Home
                            </Breadcrumb.Item>
                        </Breadcrumb>
                        <Breadcrumb>
                            <Breadcrumb.Item as={Link} to="#">
                                Home
                            </Breadcrumb.Item>
                            <Breadcrumb.Item as={Link} to="#" active>
                                Library
                            </Breadcrumb.Item>
                        </Breadcrumb>
                        <Breadcrumb>
                            <Breadcrumb.Item as={Link} to="#">
                                Home
                            </Breadcrumb.Item>
                            <Breadcrumb.Item as={Link} to="#">
                                Library
                            </Breadcrumb.Item>
                            <Breadcrumb.Item active>Data</Breadcrumb.Item>
                        </Breadcrumb>
                    </Card>
                </Col>
                <Col md={6}>
                    <Card title="Breadcrumb Icon">
                        <Breadcrumb>
                            <Breadcrumb.Item as={Link} to="#" active>
                                <i className="feather icon-home" />
                            </Breadcrumb.Item>
                        </Breadcrumb>
                        <Breadcrumb>
                            <Breadcrumb.Item as={Link} to="#">
                                <i className="feather icon-home" />
                            </Breadcrumb.Item>
                            <Breadcrumb.Item as={Link} to="#" active>
                                Library
                            </Breadcrumb.Item>
                        </Breadcrumb>
                        <Breadcrumb>
                            <Breadcrumb.Item as={Link} to="#">
                                <i className="feather icon-home" />
                            </Breadcrumb.Item>
                            <Breadcrumb.Item as={Link} to="#">
                                Library
                            </Breadcrumb.Item>
                            <Breadcrumb.Item active>Data</Breadcrumb.Item>
                        </Breadcrumb>
                    </Card>
                </Col>
            </Row>
        </React.Fragment>
    );
};

export default BasicBreadcrumbPagination;
